import React, { useState, useEffect } from 'react';
import { supabase } from '../supabaseClient';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const [applications, setApplications] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedApplication, setSelectedApplication] = useState(null);
  const [showScheduleModal, setShowScheduleModal] = useState(false);
  const [examSchedule, setExamSchedule] = useState('');
  const [examTime, setExamTime] = useState('');
  const [filterStatus, setFilterStatus] = useState('all');
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    console.log('ðŸ”„ AdminDashboard mounted - starting fetchApplications');
    fetchApplications();
  }, []);

  // ... (keep all your existing functions: fetchApplications, handleScheduleExam, etc.)

  return (
    <div className="admin-dashboard">
      {/* UPDATED: Dashboard Header */}
      <div className="dashboard-header">
        {/* Left Side: College Information */}
        <div className="college-info">
          <h1 className="college-name">Pateros Technological College</h1>
          <p className="college-subtitle">Admissions Management System</p>
          <p className="dashboard-title">Admin Dashboard</p>
        </div>

        {/* Right Side: Admin Section with Logo */}
        <div className="admin-section">
          <div className="admin-info">
            <div className="admin-name">Administrator</div>
            <div className="admin-role">System Admin</div>
          </div>
          <div className="logo-container">
            {/* Replace this with your actual logo */}
            <div className="logo-placeholder">PTC</div>
            {/* If you have an image logo, use this instead: */}
            {/* <img src="/path-to-your-logo.png" alt="College Logo" className="logo-image" /> */}
          </div>
        </div>
      </div>

      {/* Statistics Cards */}
      <div className="stats-container">
        <div className="stat-card">
          <h3>Total Applications</h3>
          <div className="stat-number">{applications.length}</div>
        </div>
        <div className="stat-card">
          <h3>Scheduled Exams</h3>
          <div className="stat-number">
            {applications.filter(app => app.status === 'scheduled').length}
          </div>
        </div>
        <div className="stat-card">
          <h3>Pending Review</h3>
          <div className="stat-number">
            {applications.filter(app => !app.status || app.status === 'submitted').length}
          </div>
        </div>
      </div>

      {/* Rest of your existing components... */}
      <div className="dashboard-controls">
        {/* ... your existing search and filter controls ... */}
      </div>

      <div className="applications-table-container">
        {/* ... your existing table ... */}
      </div>

      {/* ... your existing modal ... */}
    </div>
  );
};

export default AdminDashboard;
